import './Links.css'
import github from '../icons/github.svg'
import linkedin from '../icons/linkedin.svg'
import arrow from '../icons/arrow.svg'

function Links(props) {
  const linkArray = [
    {
      title: 'Job',
      contents: [
        {
          decription: "Visit my github account to see the projects I've made.",
          icon: github
        },
        {
          decription: "Visit my github account to see the projects I've made.",
          icon: linkedin
        }
      ]
    },
  ]

  const link = linkArray.find(element => element.title === 'Job')
  console.log(link);

  const job = [
    {
      decription: "Visit my github account to see the projects I've made.",
      icon: github
    },
    {
      decription: "Visit my github account to see the projects I've made.",
      icon: linkedin
    }
  ]
  // const art = [
  //   {
  //     decription: "Visit my github account to see the projects I've made.",
  //     icon: github
  //   },
  //   {
  //     decription: "Visit my github account to see the projects I've made.",
  //     icon: linkedin
  //   }
  // ]
  return (
    <div id='link'>
      {
        job.map((element, i) => {
          return (
            <div className="link-container">
              <div className="link-container-description">
                <p>{element.decription}</p>
              </div>
              <img className="link-container-arrow" src={arrow} alt='arrow' />
              <img className="link-container-icon" src={element.icon} alt='github'/>
            </div>
          )
        })
      }
    </div>
  )
}

export default Links
